body {
    background: url('f37665a4b07bf305b4930b64aa711b2f.jpg');
    animation: twerk 3s linear infinite;
}

@keyframes twerk {
    0% {
        background-position: 0%;
        background-size: 10%;
        transform: rotate3d(0, 1, 0, 0deg);
    }
    100% {
        background-position: 100%;
        background-size: 100%;
        transform: rotate3d(0, 0, 1, 35deg);       
    }
}
